import { Link } from "react-router-dom";

export default function Accueil() {
  return (
    <div className="accueil-container">
      <div className="card">
        <h1 className="title">Bienvenue sur Fiche de Paie</h1>
        <p className="subtitle">Générez facilement vos bulletins de paie stylisés</p>

        <div className="btn-group">
          <Link to="/formulaire" className="btn primary">Créer une fiche</Link>
          <Link to="/dashboard" className="btn secondary">Voir toutes les fiches</Link>
        </div>
      </div>
    </div>
  );
}
